import "./InformationSection.css";

import mail_logo from "./../../content/images/text_view/mail_logo.png";
import vk_logo from "./../../content/images/text_view/vk_logo.png";
import telegram_logo from "./../../content/images/text_view/telegram_logo.png";
import phone_number_logo from "./../../content/images/text_view/phone_number_logo.png";

function ContactsSection(){
    return(
        <div id="contacts">
        <div className="contact-container">
            <img src={mail_logo} alt="mail"></img>
            <div className="contact-element"><a>butacorpinf@gmail.com</a></div>
        </div>
        <div className="contact-container">
            <img src={vk_logo} alt="vk"></img>
            <div className="contact-element"><a href="https://vk.com/vladorob" style="color: rgb(250, 250, 250)">Владислав Рогозин</a></div>
        </div>
        <div className="contact-container">
            <img src={telegram_logo} alt="telegram"></img>
            <div className="contact-element"><a href="https://t.me/Vladorob" style="color: rgb(250, 250, 250)">Владислав Рогозин</a></div>
        </div>
        <div className="contact-container">
            <img src={phone_number_logo} alt="number"></img>
            <div className="contact-element"><a>+7(980)248-57-25</a></div>
        </div>
    </div>
    )
}

export default ContactsSection;
